import { Suspense } from "react";
import { RoutingComponent } from "../Router/RoutingComponent";

function App() {
  return <RoutingComponent />;
}

export default function WrappedApp() {
  return (
    <Suspense fallback="...loading">
      <App />
    </Suspense>
  );
}
